import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./Pages/Home";

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route path="/" exact element={<Home></Home>}></Route>
        </Routes>
      </Router>
    </>
  );
}

export default App;
